webpackJsonp([19202942754930],{395:function(e,i){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Сгибание рук с гантелями стоя является одним из наилучших упражнений для развития бицепса. Превосходство гантели над штангой заключается в том, что вы сможете выполнять упражнение с вращением кисти наружу – супинацией. Это позволит включить плечевую и плечелучевую мышцу.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Исходное положение: держа гантели в руках, встаньте прямо и опустите руки вдоль тела, прижав локти к туловищу. Ладони направлены вперед.</li>\n<li>На выдохе – не отрывая локти от тела, сделайте подъем рук с гантелями до уровня ваших плеч. В верхней точке упражнения немного остановитесь, напрягая бицепс.</li>\n<li>На вдохе – медленно разогните руки и возвратитесь к исходному положению.</li>\n<li>Выполните сгибание рук с гантелями требуемое количество раз.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/DG9URgrbsrU" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/concentrirovannie-sgibania-na-biceps",efficiency:"7",title:"Подъем гантелей стоя хватом молот",image:"/static/3-05-0.png",image_2:"",image_3:"",image_4:"",filterby:"biceps",date:"April 12, 2017",injury:"3",bodypart:"Бицепс",filtertype:"isolated",type:"Изолирующее",filterinventory:"dumbbells",inventory:"Гантели",filterplace:null}}},pathContext:{}}}});
